import React from 'react'

const Button = ({props, key}) => {
    console.log("props"+props)
    const color = props
    const background = document.getElementById('color').style
    return (
        <button style={{backgroundColor: color}} onClick={() => (background.backgroundColor = color)}>Color {key}</button>
    )
}
 
export default Button
